import React, { Component, useEffect, useReducer, useState } from "react";
import { NavLink, Nav, NavDropdown } from "react-router-dom";
import { useHistory } from "react-router-dom";

function Register() {

    const [username, setUsername] = useState("");
    const [email, setEmail] = useState("");
    const [firstname, setFirstname] = useState("");
    const [lastname, setLastname] = useState("");
    const [password, setPassword] = useState("");

    function signUp() {
        let item={username,email,firstname,lastname,password}
        console.warn(item)
        
    }

  return (
    <div>
      <input type="text" value={username} onChange={(e)=>setUsername(e.target.value)} className="form-control" placeholder="Username" />
      <br />
      <input type="email" value={email} onChange={(e)=>setEmail(e.target.value)} className="form-control" placeholder="Email" />
      <br />
      <input type="text" value={firstname} onChange={(e)=>setFirstname(e.target.value)} className="form-control" placeholder="First name" />
      <br />
      <input type="text" value={lastname} onChange={(e)=>setLastname(e.target.value)} className="form-control" placeholder="Last name" />
      <br />
      <input type="password" value={password} onChange={(e)=>setPassword(e.target.value)} className="form-control" placeholder="Password" />
      <br />
      <button onClick={signUp} className="btn">Register</button>
    </div>
  );
}

export default Register;
